import { defineService, implementService } from '@wix/services-definitions';
import { SignalsServiceDefinition, } from '@wix/services-definitions/core-services/signals';
export const ScheduleItemServiceDefinition = defineService('scheduleItem');
export const ScheduleItemService = implementService.withConfig()(ScheduleItemServiceDefinition, ({ getService, config }) => {
    const signalsService = getService(SignalsServiceDefinition);
    const item = signalsService.signal(config.item);
    return { item };
});
